""".trimIndent().let { csv ->
    val cells = csv.split("\n").map { it.split(",") }
    val headers = cells[0]
    val titleIdx = headers.indexOf("name.title")
    val firstNameIdx = headers.indexOf("name.first")
    val lastNameIdx = headers.indexOf("name.last")
    val cityIdx = headers.indexOf("location.city")

    cells.drop(1).mapIndexed { id, it ->
        UserModel(
            id = id,
            title = it[titleIdx],
            firstName = it[firstNameIdx],
            lastName = it[lastNameIdx],
            city = it[cityIdx],
        )
    }
}